import React, { PureComponent } from "react";
import ProfilePage from "./Profil/profil";
import Fid from "./Fid/fid";
import './HomePage.css'

class HomePage extends PureComponent {
  render() {
    return (
      <div>
        <ProfilePage />
        <Fid />
      </div>
    );
  }
}

export default HomePage;
